import { Card } from 'antd';

const LikeList = () => {

    return(
        <div className="site-card-border-less-wrapper">
        <Card
          title="Card title"
          bordered={false}
          style={{
            width: 300,
            position: 'fixed',
           
          }}
        >
          <p>Card content</p>
          <p>Card content</p>
          <p>Card content</p>
        </Card>
      </div>
    );

};

export default LikeList;
